using Rubin
using Tests
using Elliptic
using HypergeometricFunctions
using Polylogarithms
using SpecialFunctions

@test integrate(sinh(c+d*x)^4*(a+b*sech(c+d*x)^2), x) == :(x*(-3//2*b+3//8*a)+b*d^-1*tanh(c+d*x)+-1//8*d^-1*(-4b+5a)*cosh(c+d*x)*sinh(c+d*x)+1//4*a*d^-1*cosh(c+d*x)^3*sinh(c+d*x))
@test integrate(sinh(c+d*x)^3*(a+b*sech(c+d*x)^2), x) == :(b*d^-1*sech(c+d*x)+-1*d^-1*(a+-1b)*cosh(c+d*x)+1//3*a*d^-1*cosh(c+d*x)^3)
@test integrate(sinh(c+d*x)^2*(a+b*sech(c+d*x)^2), x) == :(x*(b+-1//2*a)+-1*b*d^-1*tanh(c+d*x)+(1/2)*a*d^-1*cosh(c+d*x)*sinh(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)*sinh(c+d*x), x) == :(a*d^-1*cosh(c+d*x)+-1*b*d^-1*sech(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)*csch(c+d*x), x) == :(b*d^-1*sech(c+d*x)+-1*d^-1*(a+b)*arctanh(cosh(c+d*x)))
@test integrate(csch(c+d*x)^2*(a+b*sech(c+d*x)^2), x) == :(-1*b*d^-1*tanh(c+d*x)+-1*d^-1*(a+b)*coth(c+d*x))
@test integrate(csch(c+d*x)^3*(a+b*sech(c+d*x)^2), x) == :((1/2)*d^-1*(a+3b)*arctanh(cosh(c+d*x))+-1*b*d^-1*sech(c+d*x)+-1//2*d^-1*(a+b)*coth(c+d*x)*csch(c+d*x))
@test integrate(csch(c+d*x)^4*(a+b*sech(c+d*x)^2), x) == :(b*d^-1*tanh(c+d*x)+d^-1*(a+2b)*coth(c+d*x)+-1//3*d^-1*coth(c+d*x)^3*(a+b))
@test integrate((a+b*sech(c+d*x)^2)^2*sinh(c+d*x)^4, x) == :(x*(b^2+3//8*a^2+-3*a*b)+-1//3*b^2*d^-1*tanh(c+d*x)^3+-1//4*d^-1*(a^2+4*b^2+-8*a*b)*tanh(c+d*x)+1//4*a^2*d^-1*sinh(c+d*x)^4*tanh(c+d*x)+-1//8*a*d^-1*(a+-8b)*cosh(c+d*x)*sinh(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^2*sinh(c+d*x)^3, x) == :(1//3*a^2*d^-1*cosh(c+d*x)^3+1//3*b^2*d^-1*sech(c+d*x)^3+b*d^-1*(-1b+2a)*sech(c+d*x)+-1*a*d^-1*(a+-2b)*cosh(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^2*sinh(c+d*x)^2, x) == :(-1//2*a*x*(a+-4b)+1//3*b^2*d^-1*tanh(c+d*x)^3+(1/2)*a*d^-1*(a+-4b)*tanh(c+d*x)+(1/2)*a^2*d^-1*sinh(c+d*x)^2*tanh(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^2*sinh(c+d*x), x) == :(a^2*d^-1*cosh(c+d*x)+-1//3*b^2*d^-1*sech(c+d*x)^3+-2*a*b*d^-1*sech(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^2*csch(c+d*x), x) == :(-1*d^-1*(a+b)^2*arctanh(cosh(c+d*x))+1//3*b^2*d^-1*sech(c+d*x)^3+b*d^-1*(b+2a)*sech(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^2*csch(c+d*x)^2, x) == :(-1*d^-1*(a+b)^2*coth(c+d*x)+1//3*b^2*d^-1*tanh(c+d*x)^3+-2*b*d^-1*(a+b)*tanh(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^2*csch(c+d*x)^3, x) == :((1/2)*d^-1*(a+b)*(a+5b)*arctanh(cosh(c+d*x))+-1//3*b*d^-1*(5b+6a)*sech(c+d*x)+-1//6*d^-1*(3*a^2+5*b^2+6*a*b)*coth(c+d*x)*csch(c+d*x)+1//3*b^2*d^-1*csch(c+d*x)^2*sech(c+d*x)^3)
@test integrate((a+b*sech(c+d*x)^2)^2*csch(c+d*x)^4, x) == :(-1//3*b^2*d^-1*tanh(c+d*x)^3+-1//3*d^-1*(a+b)^2*coth(c+d*x)^3+b*d^-1*(2a+3b)*tanh(c+d*x)+d^-1*(a+b)*(a+3b)*coth(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^3*sinh(c+d*x)^4, x) == :(3//8*a*x*(a^2+8*b^2+-12*a*b)+-3//8*a*d^-1*(a^2+8*b^2+-12*a*b)*tanh(c+d*x)+-1//40*b^2*d^-1*tanh(c+d*x)^5*(-48b+15a)+1//4*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^3*sinh(c+d*x)^3*cosh(c+d*x)+1//8*b*d^-1*tanh(c+d*x)^3*(-8*b^2+6*a^2+-23*a*b)+-1//8*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^2*sinh(c+d*x)^2*(-6b+3a)*tanh(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^3*sinh(c+d*x)^3, x) == :(1//3*a^3*d^-1*cosh(c+d*x)^3+1//5*b^3*d^-1*sech(c+d*x)^5+-1*a^2*d^-1*(a+-3b)*cosh(c+d*x)+1//3*b^2*d^-1*sech(c+d*x)^3*(-1b+3a)+3*a*b*d^-1*(a+-1b)*sech(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^3*sinh(c+d*x), x) == :(a^3*d^-1*cosh(c+d*x)+-1//5*b^3*d^-1*sech(c+d*x)^5+-1*a*b^2*d^-1*sech(c+d*x)^3+-3*b*a^2*d^-1*sech(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^3*csch(c+d*x), x) == :(-1*d^-1*(a+b)^3*arctanh(cosh(c+d*x))+1//5*b^3*d^-1*sech(c+d*x)^5+b*d^-1*(b^2+3*a^2+3*a*b)*sech(c+d*x)+1//3*b^2*d^-1*sech(c+d*x)^3*(b+3a))
@test integrate((a+b*sech(c+d*x)^2)^3*csch(c+d*x)^2, x) == :(-1*d^-1*(a+b)^3*coth(c+d*x)+-1//5*b^3*d^-1*tanh(c+d*x)^5+b^2*d^-1*tanh(c+d*x)^3*(a+b)+-3*b*d^-1*(a+b)^2*tanh(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^3*csch(c+d*x)^3, x) == :((1/2)*d^-1*(a+b)^2*(a+7b)*arctanh(cosh(c+d*x))+-1//2*d^-1*(a+b)^2*(a+7b)*sech(c+d*x)+-1//6*b*d^-1*sech(c+d*x)^3*(6*a^2+7*b^2+15*a*b)+-1//10*b^2*d^-1*sech(c+d*x)^5*(5a+7b)+-1//2*d^-1*(b+a*cosh(c+d*x)^2)^2*csch(c+d*x)^2*sech(c+d*x)^5*(a+b))
@test integrate((a+b*sech(c+d*x)^2)^3*csch(c+d*x)^4, x) == :(-1//3*d^-1*(a+b)^3*coth(c+d*x)^3+1//5*b^3*d^-1*tanh(c+d*x)^5+d^-1*(a+b)^2*(a+4b)*coth(c+d*x)+-1//3*b^2*d^-1*tanh(c+d*x)^3*(3a+4b)+3*b*d^-1*(a+b)*(a+2b)*tanh(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^-1*sinh(c+d*x)^4, x) == :(1//8*x*a^-3*(3*a^2+8*b^2+12*a*b)+1//4*a^-1*d^-1*cosh(c+d*x)^3*sinh(c+d*x)+-1*a^-3*b^(1/2)*d^-1*(a+b)^3//2*arctanh(b^(1/2)*(a+b)^-1//2*tanh(c+d*x))+-1//8*a^-2*d^-1*(4b+5a)*cosh(c+d*x)*sinh(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^-1*sinh(c+d*x)^3, x) == :(1//3*a^-1*d^-1*cosh(c+d*x)^3+-1*a^-2*d^-1*(a+b)*cosh(c+d*x)+a^-5//2*b^(1/2)*d^-1*(a+b)*arctan(a^(1/2)*b^-1//2*cosh(c+d*x)))
@test integrate((a+b*sech(c+d*x)^2)^-1*sinh(c+d*x)^2, x) == :(-1//2*x*a^-2*(a+2b)+(1/2)*a^-1*d^-1*cosh(c+d*x)*sinh(c+d*x)+a^-2*b^(1/2)*d^-1*(a+b)^(1/2)*arctanh(b^(1/2)*(a+b)^-1//2*tanh(c+d*x)))
@test integrate((a+b*sech(c+d*x)^2)^-1*sinh(c+d*x), x) == :(a^-1*d^-1*cosh(c+d*x)+-1*a^-3//2*b^(1/2)*d^-1*arctan(a^(1/2)*b^-1//2*cosh(c+d*x)))
@test integrate((a+b*sech(c+d*x)^2)^-1*csch(c+d*x), x) == :(-1*d^-1*(a+b)^-1*arctanh(cosh(c+d*x))+a^-1//2*b^(1/2)*d^-1*(a+b)^-1*arctan(a^(1/2)*b^-1//2*cosh(c+d*x)))
@test integrate((a+b*sech(c+d*x)^2)^-1*csch(c+d*x)^2, x) == :(-1*d^-1*(a+b)^-1*coth(c+d*x)+b^(1/2)*d^-1*(a+b)^-3//2*arctanh(b^(1/2)*(a+b)^-1//2*tanh(c+d*x)))
@test integrate((a+b*sech(c+d*x)^2)^-1*csch(c+d*x)^3, x) == :((1/2)*d^-1*(a+b)^-2*(a+-1b)*arctanh(cosh(c+d*x))+-1*d^-1*(2a+2b)^-1*coth(c+d*x)*csch(c+d*x)+-1*a^(1/2)*b^(1/2)*d^-1*(a+b)^-2*arctan(a^(1/2)*b^-1//2*cosh(c+d*x)))
@test integrate((a+b*sech(c+d*x)^2)^-1*csch(c+d*x)^4, x) == :(-1*d^-1*(3a+3b)^-1*coth(c+d*x)^3+a*d^-1*(a+b)^-2*coth(c+d*x)+-1*a*b^(1/2)*d^-1*(a+b)^-5//2*arctanh(b^(1/2)*(a+b)^-1//2*tanh(c+d*x)))
@test integrate((a+b*sech(c+d*x)^2)^-2*sinh(c+d*x)^4, x) == :(1//8*x*a^-4*(3*a^2+24*b^2+24*a*b)+1//4*a^-1*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^-1*cosh(c+d*x)^3*sinh(c+d*x)+-3//2*a^-4*b^(1/2)*d^-1*(a+b)^(1/2)*(a+2b)*arctanh(b^(1/2)*(a+b)^-1//2*tanh(c+d*x))+-3//8*b*a^-3*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^-1*(3a+4b)*tanh(c+d*x)+-1//8*a^-2*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^-1*(5a+6b)*cosh(c+d*x)*sinh(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^-2*sinh(c+d*x)^3, x) == :(1//3*a^-2*d^-1*cosh(c+d*x)^3+-1*a^-3*d^-1*(a+2b)*cosh(c+d*x)+(1/2)*a^-7//2*b^(1/2)*d^-1*(3a+5b)*arctan(a^(1/2)*b^-1//2*cosh(c+d*x))+-1//2*b*a^-3*d^-1*(b+a*cosh(c+d*x)^2)^-1*(a+b)*cosh(c+d*x))
@test integrate((a+b*sech(c+d*x)^2)^-2*sinh(c+d*x)^2, x) == :(-1//2*x*a^-3*(a+4b)+b*a^-2*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^-1*tanh(c+d*x)+(1/2)*a^-1*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^-1*cosh(c+d*x)*sinh(c+d*x)+(1/2)*a^-3*b^(1/2)*d^-1*(a+b)^-1//2*(3a+4b)*arctanh(b^(1/2)*(a+b)^-1//2*tanh(c+d*x)))
@test integrate((a+b*sech(c+d*x)^2)^-2*sinh(c+d*x), x) == :(3//2*a^-2*d^-1*cosh(c+d*x)+-3//2*a^-5//2*b^(1/2)*d^-1*arctan(a^(1/2)*b^-1//2*cosh(c+d*x))+-1//2*a^-1*d^-1*(b+a*cosh(c+d*x)^2)^-1*cosh(c+d*x)^3)
