@test integrate((a+b*sech(c+d*x)^2)^-2*csch(c+d*x)^2, x) == :(-3//2*d^-1*(a+b)^-2*coth(c+d*x)+d^-1*(2a+2b)^-1*(a+b+-1*b*tanh(c+d*x)^2)^-1*coth(c+d*x)+3//2*b^(1/2)*d^-1*(a+b)^-5//2*arctanh(b^(1/2)*(a+b)^-1//2*tanh(c+d*x)))
@test integrate((a+b*sech(c+d*x)^2)^-2*csch(c+d*x)^3, x) == :((1/2)*d^-1*(a+b)^-3*(a+-3b)*arctanh(cosh(c+d*x))+-1*d^-1*(b+a*cosh(c+d*x)^2)^-1*(2a+2b)^-1*coth(c+d*x)*csch(c+d*x)+-1//2*d^-1*(a+b)^-2*(b+a*cosh(c+d*x)^2)^-1*(a+-1b)*cosh(c+d*x)+-1//2*a^-1//2*b^(1/2)*d^-1*(a+b)^-3*(-1b+3a)*arctan(a^(1/2)*b^-1//2*cosh(c+d*x)))
