@test integrate((a+b*sech(c+d*x)^2)^-3*sinh(c+d*x)^4, x) == :(1//8*x*a^-5*(3*a^2+48*b^2+36*a*b)+1//4*a^-1*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^-2*cosh(c+d*x)^3*sinh(c+d*x)+-3//2*b*a^-4*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^-1*(a+2b)*tanh(c+d*x)+-3//8*a^-5*b^(1/2)*d^-1*(a+b)^-1//2*(5*a^2+16*b^2+20*a*b)*arctanh(b^(1/2)*(a+b)^-1//2*tanh(c+d*x))+-1//8*b*a^-3*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^-2*(7a+12b)*tanh(c+d*x)+-1//8*a^-2*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^-2*(5a+8b)*cosh(c+d*x)*sinh(c+d*x))
