@test integrate((a+b*sech(c+d*x)^2)^-3*sinh(c+d*x)^2, x) == :(-1//2*x*a^-4*(a+6b)+(1/2)*a^-1*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^-2*cosh(c+d*x)*sinh(c+d*x)+3//4*b*a^-2*d^-1*(a+b+-1*b*tanh(c+d*x)^2)^-2*tanh(c+d*x)+1//8*a^-4*b^(1/2)*d^-1*(a+b)^-3//2*(15*a^2+24*b^2+40*a*b)*arctanh(b^(1/2)*(a+b)^-1//2*tanh(c+d*x))+1//8*b*a^-3*d^-1*(a+b)^-1*(a+b+-1*b*tanh(c+d*x)^2)^-1*(11a+12b)*tanh(c+d*x))
