@test integrate((a+b*sech(c+d*x)^2)^-3*csch(c+d*x)^2, x) == :(-15//8*d^-1*(a+b)^-3*coth(c+d*x)+d^-1*(4a+4b)^-1*(a+b+-1*b*tanh(c+d*x)^2)^-2*coth(c+d*x)+5//8*d^-1*(a+b)^-2*(a+b+-1*b*tanh(c+d*x)^2)^-1*coth(c+d*x)+15//8*b^(1/2)*d^-1*(a+b)^-7//2*arctanh(b^(1/2)*(a+b)^-1//2*tanh(c+d*x)))
@test integrate((a+b*sech(c+d*x)^2)^-3*csch(c+d*x)^3, x) == :((1/2)*d^-1*(a+b)^-4*(a+-5b)*arctanh(cosh(c+d*x))+-1*d^-1*(b+a*cosh(c+d*x)^2)^-2*(2a+2b)^-1*coth(c+d*x)^2*cosh(c+d*x)+-1//8*a^-1*d^-1*(a+b)^-3*(b+a*cosh(c+d*x)^2)^-1*(-1*b^2+4*a^2+-9*a*b)*cosh(c+d*x)+-1//8*a^-3//2*b^(1/2)*d^-1*(a+b)^-4*(-1*b^2+15*a^2+-10*a*b)*arctan(a^(1/2)*b^-1//2*cosh(c+d*x))+1//4*b*a^-1*d^-1*(a+b)^-2*(b+a*cosh(c+d*x)^2)^-2*(-1b+2a)*cosh(c+d*x))
